import React from 'react';
import logo from './logo.svg';
import './App.css';

class Home extends React.Component {

  render () {
  return (
    <div className="App">
      <h1>
        Hello
      </h1>
      {this.state.countries.map((country, ind) =>
          <p key={ind}>{ind+1} {country.name}</p>
        )}
    </div>
  );}
}

export default Home;
